import { Button, Grid, Box, IconButton } from '@mui/material';
import Container from '@mui/material/Container';
import React from 'react';
import jverde from '../jverde.png';
import jvermelho from '../jvermelho.png';

const Mapa = () => {
    //dummy, remover depois
    const getOccupationStatus = () => { return true; };

    const gridItems = Array.from({ length: 120 }, (_, index) => (
        <Grid item key={index} xs={5} sm={4} md={3} lg={2} xl={1}>
            {<IconButton id={index}> <img src={getOccupationStatus() ? jverde : jvermelho} alt="icone" /></IconButton>}
        </Grid>
    ));

    return (
        <React.Fragment>
            <Container>
                <Grid container rowSpacing={2} columnSpacing={2}>{gridItems}</Grid>
            </Container>
        </React.Fragment>
    );
}

export default Mapa;
